import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const Resume = () => {
  const { role } = useParams();
  const [resume, setResume] = useState(null);

  useEffect(() => {
    const fetchResume = async () => {
      try {
        const response = await axios.get(`http://localhost:8085/api/resume/get/${role}`);
        console.log(response);
        setResume(response.data);
      } catch (error) {
        console.error('Error fetching resume', error);
      }
    };

    fetchResume();
  }, [role]);

  return (
    <>
      <div className="bg-white">
        <div className="relative isolate px-6 pt-14 lg:px-8">
          <div
            className="absolute inset-x-0 -top-40 -z-10 transform-gpu overflow-hidden blur-3xl sm:-top-80"
            aria-hidden="true"
          >
            <div
              className="relative left-[calc(50%-11rem)] aspect-[1155/678] w-[36.125rem] -translate-x-1/2 rotate-[30deg] bg-gradient-to-tr from-[#ff80b5] to-[#9089fc] opacity-30 sm:left-[calc(50%-30rem)] sm:w-[72.1875rem]"
              style={{
                clipPath:
                  'polygon(74.1% 44.1%, 100% 61.6%, 97.5% 26.9%, 85.5% 0.1%, 80.7% 2%, 72.5% 32.5%, 60.2% 62.4%, 52.4% 68.1%, 47.5% 58.3%, 45.2% 34.5%, 27.5% 76.7%, 0.1% 64.9%, 17.9% 100%, 27.6% 76.8%, 76.1% 97.7%, 74.1% 44.1%)',
              }}
            />
          </div>
          <div className="mx-auto max-w-2xl sm:py-48 lg:py-10">
            <div className="text-center">
              <h1 className="text-4xl font-bold tracking-tight text-gray-900 sm:text-6xl">
                {role.charAt(0).toUpperCase() + role.slice(1)} Resumes
              </h1>
            </div>
          </div>
          {resume ? (
            resume.map((res, index) => {
              const developerfeatures = [
                { name: 'Qualifications:', description: res.qualifications },
                { name: 'Tech Skills', description: res.techSkills },
                { name: 'Business Impact', description: res.businessImpact },
                { name: 'Email', description: res.email },
              ];

              const tutorfeatures = [
                { name: 'Courses Taken', description: res.coursesTaught },
                { name: 'Year Of Experience', description: res.yearsOfExperience },
                { name: 'Email', description: res.email },
              ];

              const features = role === 'developer' ? developerfeatures : tutorfeatures;

              return (
                <div
                  className="mx-auto grid max-w-2xl grid-cols-1 items-center gap-x-8 gap-y-16 px-4 py-24 sm:px-6 sm:py-32 lg:max-w-7xl lg:grid-cols-2 lg:px-8"
                  key={index}
                >
                  <div>
                    <h2 className="text-3xl font-bold tracking-tight text-gray-900 sm:text-4xl">
                      {res.firstName + " " + res.lastName}
                    </h2>
                    <p className="mt-4 text-gray-500">
                    {res.workExperience}
                    </p>
                    <dl className="mt-16 grid grid-cols-1 gap-x-6 gap-y-10 sm:grid-cols-2 sm:gap-y-16 lg:gap-x-8">
                      {features.map((feature) => (
                        <div key={feature.name} className="border-t border-gray-200 pt-4">
                          <dt className="font-medium text-gray-900">{feature.name}</dt>
                          <dd className="mt-2 text-sm text-gray-500">{feature.description}</dd>
                        </div>
                      ))}
                    </dl>
                  </div>
                  <div className="rid grid-cols-g2 grid-rows-2 gap-4 sm:gap-6 lg:gap-8">
                    <img
                      src="https://tailwindui.com/img/ecommerce-images/product-feature-03-detail-01.jpg"
                      alt="Walnut card tray with white powder coated steel divider and 3 punchout holes."
                      className="rounded-lg bg-gray-100"
                    />
                  </div>
                </div>
              );
            })
          ) : (
            <p>Loading...</p>
          )}
          <div
            className="absolute inset-x-0 top-[calc(100%-13rem)] -z-10 transform-gpu overflow-hidden blur-3xl sm:top-[calc(100%-30rem)]"
            aria-hidden="true"
          >
            <div
              className="relative left-[calc(50%+3rem)] aspect-[1155/678] w-[36.125rem] -translate-x-1/2 bg-gradient-to-tr from-[#ff80b5] to-[#9089fc] opacity-30 sm:left-[calc(50%+36rem)] sm:w-[72.1875rem]"
              style={{
                clipPath:
                  'polygon(74.1% 44.1%, 100% 61.6%, 97.5% 26.9%, 85.5% 0.1%, 80.7% 2%, 72.5% 32.5%, 60.2% 62.4%, 52.4% 68.1%, 47.5% 58.3%, 45.2% 34.5%, 27.5% 76.7%, 0.1% 64.9%, 17.9% 100%, 27.6% 76.8%, 76.1% 97.7%, 74.1% 44.1%)',
              }}
            />
          </div>
        </div>
      </div>
    </>
  );
};

export default Resume;
